        React.createElement("path", { d: "M32.37 18.37a1.25 1.25 0 011.76 0L38 22.23l3.87-3.86a1.25 1.25 0 111.76 1.76L39.77 24l3.86 3.87a1.25 1.25 0 01-1.76 1.76L38 25.77l-3.87 3.86a1.25 1.25 0 01-1.76-1.76L36.23 24l-3.86-3.87a1.25 1.25 0 010-1.76z", fill: primaryFill }));
};
const SpeakerMute48Filled = wrapIcon(rawSvg({}), 'SpeakerMute48Filled');
export default SpeakerMute48Filled;
